#
# TABLE STRUCTURE FOR: areas
#

USE fns;


DROP TABLE IF EXISTS `areas`;

CREATE TABLE `areas` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID земли',
  `address` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Адрес',
  `area` int(10) DEFAULT NULL COMMENT 'Площадь',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Земля';



#
# TABLE STRUCTURE FOR: cars
#

DROP TABLE IF EXISTS `cars`;

CREATE TABLE `cars` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID авто',
  `model` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Модель авто',
  `car_power` int(10) DEFAULT NULL COMMENT 'Мощность авто',
  `date_of_issue` datetime DEFAULT NULL COMMENT 'Дата изготовления',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: estate
#

DROP TABLE IF EXISTS `estate`;

CREATE TABLE `estate` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `car_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на авто',
  `flats_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на квартиры',
  `other_estate_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на нежилые помещения',
  `areas_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на землю',
  PRIMARY KEY (`id`),
  KEY `car_id` (`car_id`),
  KEY `areas` (`areas_id`),
  KEY `flats` (`flats_id`),
  KEY `other_estate` (`other_estate_id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Собственность налогоплательщиков';



#
# TABLE STRUCTURE FOR: flats
#

DROP TABLE IF EXISTS `flats`;

CREATE TABLE `flats` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID авто',
  `address` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Адрес',
  `area` int(10) DEFAULT NULL COMMENT 'Площадь',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Квартира';



#
# TABLE STRUCTURE FOR: income
#

DROP TABLE IF EXISTS `income`;

CREATE TABLE `income` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `income` int(100) NOT NULL COMMENT 'Доход',
  `tax_income` int(100) NOT NULL COMMENT 'Уплаченный налог на доход',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Доход';



#
# TABLE STRUCTURE FOR: messages
#

DROP TABLE IF EXISTS `messages`;

CREATE TABLE `messages` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `from_user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на отправителя сообщения',
  `body` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Текст сообщения',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Сообщения';



#
# TABLE STRUCTURE FOR: other_estate
#

DROP TABLE IF EXISTS `other_estate`;

CREATE TABLE `other_estate` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID нежилого помещения',
  `address` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Адрес',
  `area` int(10) DEFAULT NULL COMMENT 'Площадь',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Нежилое помещение';



#
# TABLE STRUCTURE FOR: profiles
#

DROP TABLE IF EXISTS `profiles`;

CREATE TABLE `profiles` (
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `gender` char(1) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Пол',
  `birthday` date DEFAULT NULL COMMENT 'Дата рождения',
  `city` varchar(130) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Город проживания',
  `country` varchar(130) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Страна проживания',
  `address` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Адрес',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Профили';



#
# TABLE STRUCTURE FOR: taxes
#

DROP TABLE IF EXISTS `taxes`;

CREATE TABLE `taxes` (
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `total_taxes` int(12) NOT NULL COMMENT 'Итого налог',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Налоги';



#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `taxpayer_number` bigint(200) NOT NULL COMMENT 'ИНН',
  `first_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Имя пользователя',
  `last_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Фамилия пользователя',
  `email` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Почта',
  `phone` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Телефон',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `phone` (`phone`),
  UNIQUE KEY `taxpayer_number` (`taxpayer_number`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Пользователи';



